  `update_user_id` int(11) DEFAULT NULL COMMENT '修改人的唯一标识',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`main_id`),
  UNIQUE KEY `role_request_id` (`request_id`,`role_id`),
  KEY `web_role_request_requestid` (`request_id`),
  KEY `web_role_request_roleid` (`role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8 COMMENT='角色对应的请求和按钮的权限 角色对应的请求和按钮的权限。';
