--
-- Table structure for table `web_user`
--

DROP TABLE IF EXISTS `web_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `web_user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键，唯一标识',
  `code` varchar(32) NOT NULL COMMENT '编号',
  `password` varchar(100) NOT NULL COMMENT '登录的密码',
  `tel` varchar(32) DEFAULT NULL COMMENT '手机号',
  `mail` varchar(32) DEFAULT NULL COMMENT '邮箱地址',
  `nickname` varchar(32) CHARACTER SET utf8mb4 NOT NULL COMMENT '昵称',
  `province` varchar(32) DEFAULT NULL COMMENT '所在省份',
  `city` varchar(32) DEFAULT NULL COMMENT '所在市',
  `district` varchar(32) DEFAULT NULL COMMENT '所在区',
  `birthday` varchar(32) DEFAULT NULL COMMENT '出生年月',
  `icon` varchar(128) DEFAULT NULL COMMENT '头像地址',
  `user_type` varchar(4) NOT NULL DEFAULT '0' COMMENT '登录用户的类别，默认0，0客户端普通用户；1管理端用户',
  `status` varchar(4) NOT NULL DEFAULT '0' COMMENT '用户的状态，默认0，0注册（默认状态）；1有效（可以登录系统）；2无效。',
  `create_user_id` int(11) DEFAULT NULL COMMENT '创建人的唯一标识',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据创建时间',
  `update_user_id` int(11) DEFAULT NULL COMMENT '修改人的唯一标识',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据修改时间',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_id_UNIQUE` (`user_id`),
  UNIQUE KEY `code_UNIQUE` (`code`),
  KEY `code_index` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='用户信息';
/*!40101 SET character_set_client = @saved_cs_client */;

